//import { PostCard } from '../PostCard';

import { PostCard } from "../PostCard";

export const Posts = ({posts}) => (
    <div className="posts">
          
    { Posts.map(post => (
      <PostCard 
        key={post.id} 
        title = { post.title }
        body = { post.cover }
        id = {post.id} 
        cover = {post.cover}
      />
    ))}

  </div>
);
